import React, { Component } from 'react';

import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import songList from "./songlist"

import { render } from '@testing-library/react';
class App extends Component {
  render() {
    return (<div className="App" >
      <songList></songList>
      <div>this</div>
    </div>)

  }

};



export default App;
